import React from "react";
import Navbar from "./components/Navbar"; 
import {Routes, Route} from "react-router-dom";

const App = () => {
  return (
    <div>
      <Navbar />

      <Routes>
        <Route path= "/" element = {<Home />} />
        <Route path= "/"signup element = {<SignUpPage />} />
        <Route path= "/login" element = {<Home />} />
        <Route path= "/" element = {<Home />} />
      </Routes>
    </div>
  );
};

export default App;
